import React from "react";

//image
import logo from "../../UI/Img/softechsolutions_header_log.png";
import logo_s from "../../UI/Img/softechsolutions_logo.png";

//bootstrap
import { Card, ListGroup } from "react-bootstrap";

//css
import style from "../Footer/footer.module.css";

const Footer = () => {
  return (
    <div className={style.footer_container}>
      <Card border="primary" style={{ width: "20rem", height: "20rem", borderRadius:"2rem" }}>
        <div className={style.card_img_container}>
          <Card.Img
            variant="top"
            src={logo_s}
            style={{ width: "2rem" }}
            bsPrefix={style.card_img}
          />
          <Card.Img
            variant="top"
            src={logo}
            style={{ width: "10rem" }}
            bsPrefix={style.card_img}
          />
        </div>
        <Card.Body>
          <Card.Title>Info</Card.Title>
          <Card.Text>
            Softech ERP Solutions Pvt. Ltd. is a software development firm
            located in the metropolis of Kolkata, India. The company started its
            operation as Softech Solutions in 2002 and was later incorporated in
            2011.
          </Card.Text>
        </Card.Body>
      </Card>

      <Card border="primary" style={{width: "20rem", height: "20rem", borderRadius:"2rem",marginLeft:"1rem" }}>
    <Card.Header style={{borderRadius:"2rem 2rem 0 0"}}>Services</Card.Header>
    <Card.Body>
      <Card.Title></Card.Title>
      <ListGroup variant="flush">
    <ListGroup.Item action >Consulting</ListGroup.Item>
    <ListGroup.Item>IT & Web applications</ListGroup.Item>
    <ListGroup.Item>Website development</ListGroup.Item>
    <ListGroup.Item>Domain & Hosting Service</ListGroup.Item>
  </ListGroup>
    </Card.Body>
  </Card>
    </div>
  );
};

export default Footer;
